import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import img from "../pictures/234403.jpg"
import "../styles/Front.css";
import axios from "axios";
import React , {useEffect, useState} from "react";
import { useParams } from "react-router-dom";

function Front(){
  const { id } = useParams();
        
  const [user , setUser] = useState({
    email : "" , pass :"" , info:[]
 
   });

   function Loaddata(){
    axios.get("/update/"+id )
    .then((res)=> {
       console.log(res);
      setUser(res.data)
    })
    .catch((err)=>{
        console.log(err); 
      })
}


    useEffect(()=>{
      Loaddata();
    }, []
  )

    function UpdateData(e){
        e.preventDefault();
        axios.put("/update/"+id , user)
        .then(data=>{
          console.log(data)

          history.push("/");
        }).catch((err)=>{
            console.log(err);
          })
      }



    


    return(
        <>
        { user.info.map((post , pos )=>{
             return(
            
    <div className="container">
        <img src={img} className="rounded" alt="..."/>
    

            <div className="centered">Hello {post.name}</div>
        

        
           
    </div>
    
    )
})
}
        </>
        
    )

}
export default Front;
